import React, { useEffect, useState } from "react";
import { supabase } from "../supabase/client";
import styles from "./OrdersAdmin.module.css";

const OrdersAdmin = () => {
  const [orders, setOrders] = useState([]);
  const [loading, setLoading] = useState(true);
  const [user, setUser] = useState(null);

  // 🔐 Solo el admin puede ver esta página
  const ADMIN_EMAIL = "admin@tiendareptil.com"; // ⚠️ Cambia esto por el tuyo

  useEffect(() => {
    const fetchOrders = async () => {
      const { data: userData } = await supabase.auth.getUser();
      const currentUser = userData?.user;
      setUser(currentUser);

      if (!currentUser || currentUser.email !== ADMIN_EMAIL) {
        setLoading(false);
        return;
      }

      const { data, error } = await supabase
        .from("orders")
        .select(`
          id,
          total,
          status,
          created_at,
          user_id,
          profiles ( name, address ),
          order_items (
            quantity,
            price,
            products ( name )
          )
        `)
        .order("created_at", { ascending: false });

      if (error) {
        console.error("Error al cargar pedidos:", error);
      } else {
        setOrders(data);
      }
      setLoading(false);
    };

    fetchOrders();
  }, []);

  const updateStatus = async (orderId, newStatus) => {
    const { error } = await supabase
      .from("orders")
      .update({ status: newStatus })
      .eq("id", orderId);

    if (!error) {
      setOrders((prev) =>
        prev.map((order) =>
          order.id === orderId ? { ...order, status: newStatus } : order
        )
      );
    }
  };

  if (loading) return <p>Cargando pedidos...</p>;

  if (!user || user.email !== ADMIN_EMAIL)
    return <p>❌ No tienes permiso para ver esta página.</p>;

  return (
    <div className={styles.container}>
      <h2>📦 Panel de Pedidos</h2>
      {orders.length === 0 ? (
        <p>No hay pedidos registrados.</p>
      ) : (
        <div className={styles.ordersList}>
          {orders.map((order) => (
            <div key={order.id} className={styles.orderCard}>
              <h3>Pedido #{order.id}</h3>
              <p>
                <strong>Usuario:</strong>{" "}
                {order.profiles?.name || "Sin nombre registrado"}
              </p>
              <p>
                <strong>Dirección:</strong>{" "}
                {order.profiles?.address || "No proporcionada"}
              </p>
              <p>
                <strong>Total:</strong> ${order.total}
              </p>
              <p>
                <strong>Estado:</strong>{" "}
                <span className={styles.status}>{order.status}</span>
              </p>
              <div className={styles.items}>
                <strong>Productos:</strong>
                <ul>
                  {order.order_items.map((item, i) => (
                    <li key={i}>
                      {item.products?.name} — {item.quantity} × ${item.price}
                    </li>
                  ))}
                </ul>
              </div>
              <div className={styles.actions}>
                <button onClick={() => updateStatus(order.id, "pagado")}>
                  💳 Marcar como Pagado
                </button>
                <button onClick={() => updateStatus(order.id, "enviado")}>
                  🚚 Marcar como Enviado
                </button>
                <button onClick={() => updateStatus(order.id, "completado")}>
                  ✅ Completar
                </button>
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default OrdersAdmin;
